from typing import List

# class Solution:
#     def maxArea(self, height: List[int]) -> int:
#         maxValue = 0
#         len_height = len(height)
#         for i in range(0, len_height):
#             for j in range(i+1, len_height):
#                 area = (j-i) * min(height[i], height[j])
#                 if maxValue < area:
#                     maxValue = area

#         return maxValue


class Solution:
    def maxArea(self, height: List[int]) -> int:
        maxValue = 0
        r_index = len(height) - 1
        l_index = 0
        while l_index < r_index:
            area = (r_index - l_index) * min(height[l_index], height[r_index])
            if area > maxValue:
                maxValue = area
            if height[l_index] < height[r_index]:
                l_index = l_index + 1
            else:
                r_index = r_index - 1

        return maxValue

